import React from 'react';

// COMPONENTS
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';

// IMAGES
import City1 from '../Images/City1.JPG'
import City2 from '../Images/City2.jpg'
import City3 from '../Images/City3.jpg'

// CSS
import '../css/Interests.css'

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <Parallax 
                    className = 'Parallax' 
                    ref={ref => (this.parallax = ref)} 
                    pages={2} 
                    style = {{ 'height': '90vh' }}>

                    <div className = 'Pictures'>

                        <ParallaxLayer 
                            speed={-1.2} 
                            style = {{'color': 'red'}}
                            offset={.08}>
                            <div className = 'Topic'>
                                <h1>Photography</h1>
                            </div>
                        </ParallaxLayer>
                        <ParallaxLayer 
                            speed={-.8} 
                            style = {{'color': 'blue'}}
                            offset={.08}>
                            <div className = 'Topic'>
                                <h1>Photography</h1>
                            </div>
                        </ParallaxLayer>
                        <ParallaxLayer 
                            speed={-1} 
                            offset={.08}>
                            <div className = 'Topic'>
                                <h1>Photography</h1>
                            </div>
                        </ParallaxLayer>

                        <ParallaxLayer
                            speed={.5}
                            offset={.2}
                            factor = {1}>

                            <div className = 'Container-1'>
                                <img src = {City1} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer 
                            speed={1} 
                            offset={.2} 
                            factor = {1}>

                            <div className = 'Container-2'>
                                <img src = {City2} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                        <ParallaxLayer 
                            speed={1.5} 
                            offset={.2} 
                            factor = {1}>

                            <div className = 'Container-3'>
                                <img src = {City3} className = 'Image'/> 
                            </div>

                        </ParallaxLayer>

                    </div>

                    <ParallaxLayer 
                        className = 'MusicBase' 
                        speed={.7} 
                        offset={1} 
                        factor = {.3}>

                        <div>
                            <h1>Music</h1>
                        </div>

                    </ParallaxLayer>

                </Parallax>

            </div>

        )
    }

}
